.navbar-fixed-top{
    position:relative;
    height:auto;
}
.navbar-inner{
    background:rgba(0,255,0,0.3) !important;
}
.navbar-inner > .container{
    display:grid;
    grid-template-rows:auto;
    grid-template-columns:auto auto;
    justify-content:center;
}
.navbar-inner > .container > .logo{
    grid-column:1;
}
.navbar-inner > .container > .pull-right{
    grid-column:-1;
}
.navbar{
    background:#000;
}
}

@-moz-document url-prefix("https://conalep.territorio.la/init.php") {
body{
    padding:0;
    margin:0;
    background:#000 !important;
}
body > .container{
    display:grid;
    grid-template-columns:auto;
    grid-template-rows:auto;
    justify-content:center;
}
body > .container > .row{
    margin:0;
}
p,li,span{
    color:#fff !important;
}
a{
    text-decoration:none;
    color:#fff !important;
}
a > img{
    width:100%;
}
iframe{
    background:red;
}
textarea{
    background:#000;
    color:#fff;
    border:1px solid #fff;
    border-radius:1px;
}
.well-2, .well-2> div{
    background-color:#000 !important;
}
.span4{
    color:#fff !important;
}
.span8{
    color:#fff !important;
}
.color2{
    color:rgba(255,255,255,0.5) !important;
}
.navbar-fixed-top{
    position:relative;
    height:auto;
}
.navbar-inner{
    background:rgba(0,255,0,0.3) !important;
}
.navbar-inner > .container{
    display:grid;
    grid-template-rows:auto;
    grid-template-columns:auto auto;
    justify-content:center;
}
.navbar-inner > .container > .logo{
    grid-column:1;
}
.navbar-inner > .container > .pull-right{
    grid-column:-1;
}
.navbar{
    background:#000;
}
.marginTopInit{
    display:grid;
    grid-template-columns:auto auto;
    grid-template-rows:auto auto;
    width:100%;
    overflow:auto;
    align-content:center;
    justify-content:center;
}
.marginTopInit > .wideDiv{
    width:200px;
    margin:0;
    grid-column:1;
    grid-row:1;
    padding:10px;
}
.marginTopInit > #main-content-init{
    grid-row:1;
    grid-column:2;
    margin:0;
    padding:10px;
}
.marginTopInit > .wideDiv > .accordion{
    margin:0;
    padding:0;
}
.marginTopInit > .wideDiv > .accordion > .accordion-group{
    margin:0;
    padding:5;
    background:rgba(0,0,0,0.1);
    border:1px solid #fff;
    border-radius:1px;
    color:#fff;
}

.well{
    background:#000;
    margin:0;
    border:1px solid #fff;
}
.botonPersonalizadoBootstrap{
    border:1px solid #fff;
    background:rgba(0,255,0,0.25) !important;
}
}
